import api from "../../API/Api";

const getCompanyType = () => {
  return api.get("/companyType/All");
};
const getEntitype = () => {
  return api.get("/entityType/All");
};
const getCountry = () => {
  return api.get("/country/All");
};
const getRegion = () => {
  return api.get("/Regions/All");
};
const getProofOfIdentityTypes = () => {
  return api.get(`/ProofOfIdentityType/All`, {
    headers: {
      Authorization: `bearer ${localStorage.getItem("token")}`,
      "Content-Type": "application/json",
    },
  });
};
const getMaritalStatus = () => {
  return api.get("/MaritalStatusType/All", {
    headers: {
      Authorization: `bearer ${localStorage.getItem("token")}`,
      "Content-Type": "application/json",
    },
  });
};
const getMartialStatusBySoleMarriedId = (soleAndPartnershipId) => {
  return api.get(`SoleAndPartnership/${soleAndPartnershipId}/Married`, {
    headers: {
      Authorization: `bearer ${localStorage.getItem("token")}`,
      "Content-Type": "application/json",
    },
  });
};
const getUnMartialStatusBySoleMarriedId = (soleAndPartnershipId) => {
  return api.get(`SoleAndPartnership/${soleAndPartnershipId}/Unmarried`, {
    headers: {
      Authorization: `bearer ${localStorage.getItem("token")}`,
      "Content-Type": "application/json",
    },
  });
};

const marriedSole = (data, Id) => {
  debugger;
