    headers: {
      Authorization: `bearer ${localStorage.getItem("token")}`,
      "Content-Type": "application/json",
    },
  });
};
const getMarried = (Id) => {
  debugger;
  return api.get(`SoleAndPartnership/Married/${Id}`, {
    headers: {
      Authorization: `bearer ${localStorage.getItem("token")}`,
      "Content-Type": "application/json",
    },
  });
};
const updateMarried = (Id, data) => {
  debugger;
  return api.put(`SoleAndPartnership/Married/${Id}`, data, {
    headers: {
      Authorization: `bearer ${localStorage.getItem("token")}`,
      "Content-Type": "application/json",
    },
  });
};
const getUnmarried = (Id) => {
  debugger
  return api.get(`SoleAndPartnership/Unmarried/${Id}`, {
    headers: {
      Authorization: `bearer ${localStorage.getItem("token")}`,
      "Content-Type": "application/json",
    },
  });
};
const updateUnmarried = (Id, data) => {
  debugger
  return api.put(`/soleAndPartnership/Unmarried/${Id}`, data, {
    headers: {
      Authorization: `bearer ${localStorage.getItem("token")}`,
      "Content-Type": "application/json",
    },
  });
};
const UnmarriedSole = (data, Id) => {
  return api.post(`SoleAndPartnership/${Id}/Unmarried`, data, {
    headers: {
      Authorization: `bearer ${localStorage.getItem("token")}`,
      "Content-Type": "application/json",
    },
  });
};

const getWidowedStatusBySoleMarriedId = (soleAndPartnershipId) => {
  return api.get(`SoleAndPartnership/${soleAndPartnershipId}/Widowed`, {
    headers: {
      Authorization: `bearer ${localStorage.getItem("token")}`,
      "Content-Type": "application/json",
    },
  });
};
const updateWidowed = (Id, data) => {
  debugger
  return api.get(`/soleAndPartnership/Widowed/${Id}`, data, {
    headers: {
      Authorization: `bearer ${localStorage.getItem("token")}`,
      "Content-Type": "application/json",
    },
  });
};
const CommonServices = {
  getCompanyType,
  getEntitype,
  getCountry,
  getRegion,
  getProofOfIdentityTypes,
  getMaritalStatus,
  getMartialStatusBySoleMarriedId,
  marriedSole,
  getMarried,
  updateMarried,
  getUnmarried,
  updateUnmarried,
  getUnMartialStatusBySoleMarriedId,
  UnmarriedSole,
  getWidowedStatusBySoleMarriedId,
  updateWidowed,
};
